DROP TABLE  HEADSDA;
CREATE TABLE  HEADSDA  ( 
	RESOURCEID      	VARCHAR(40) NOT NULL,
	STRUCTNAME      	VARCHAR(100) NOT NULL,
	STRUCTALIAS     	VARCHAR(100),
	SERVICEID       	VARCHAR(40) NOT NULL,
	STRUCTINDEX     	INTEGER,
	METADATAID      	VARCHAR(40),
	ACTIONID        	VARCHAR(40) NOT NULL,
	PARENTRESOURCEID	VARCHAR(40),
	TYPE            	VARCHAR(10),
	REMARK          	VARCHAR(500),
	REQUIRED        	VARCHAR(10),
	VERSIONNO       	VARCHAR(40),
	UPDATEDATE      	VARCHAR(40),
	VERSIONST       	VARCHAR(40),
	PRODUCTNO       	VARCHAR(40) 
	)
;
COMMENT ON TABLE  HEADSDA IS '业务报文头SDA信息表'
;
COMMENT ON COLUMN  HEADSDA.RESOURCEID IS '主键ID'
;
COMMENT ON COLUMN  HEADSDA.STRUCTNAME IS '节点ID'
;
COMMENT ON COLUMN  HEADSDA.STRUCTALIAS IS '节点别名'
;
COMMENT ON COLUMN  HEADSDA.SERVICEID IS '服务ID'
;
COMMENT ON COLUMN  HEADSDA.STRUCTINDEX IS '索引值'
;
COMMENT ON COLUMN  HEADSDA.METADATAID IS '元数据ID'
;
COMMENT ON COLUMN  HEADSDA.PARENTRESOURCEID IS '父ID'
;
COMMENT ON COLUMN  HEADSDA.TYPE IS '类型'
;
COMMENT ON COLUMN  HEADSDA.REMARK IS '描述'
;
COMMENT ON COLUMN  HEADSDA.REQUIRED IS '是否必输'
;
COMMENT ON COLUMN  HEADSDA.VERSIONNO IS '版本号'
;
COMMENT ON COLUMN  HEADSDA.UPDATEDATE IS '更新日期'
;
COMMENT ON COLUMN  HEADSDA.VERSIONST IS '版本状态'
;
COMMENT ON COLUMN  HEADSDA.PRODUCTNO IS '生产版本号'
;
